import React from "react";
import './Logo.css';
import logoImage from '../Image/Logo.png';


const Logo = () => {
  return (
      <div className="" style={{borderStyle: ''}}>
         <img src={logoImage} alt="Logo" className="logo-image"/>
      </div>
  );
}
export default Logo;
